import React from 'react';
import { Card, CardContent, Typography, Box, Table, TableContainer, TableHead, TableRow, TableCell, TableBody, Collapse } from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore'; // Asegúrate de tener esto importado correctamente

const ResultsComponent = ({ results }) => {
  if (!results) return null;

  const { data, meta } = results;

  if (!data || !data.attributes || !data.attributes.stats) return null;

  const { stats } = data.attributes;

  // Convert stats object into an array of objects for easier mapping
  const statsArray = [
    { category: 'Harmless', count: stats.harmless },
    { category: 'Malicious', count: stats.malicious },
    { category: 'Suspicious', count: stats.suspicious },
    { category: 'Timeout', count: stats.timeout },
    { category: 'Undetected', count: stats.undetected }
  ];

  // State para controlar la expansión del contenido
  const [expanded, setExpanded] = React.useState(false);

  const handleExpandClick = () => {
    setExpanded(!expanded);
  };

  return (
    <Box sx={{ mt: 4 }}>
      <Card>
        <CardContent>
          <Typography variant="h5" component="h2">
            Analysis Results
          </Typography>
          <TableContainer sx={{ mt: 2 }}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Category</TableCell>
                  <TableCell align="right">Count</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {statsArray.map((stat, index) => (
                  <TableRow key={index}>
                    <TableCell>{stat.category}</TableCell>
                    <TableCell align="right">{stat.count}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </CardContent>
      </Card>

      <Box sx={{ mt: 4 }}>
        <Card>
          <CardContent>
            <Typography variant="h5" component="h2">
              Analysis Results
            </Typography>
            <Typography variant="body2" component="pre" sx={{ mt: 2 }}>
              {JSON.stringify(data, null, 2)}
            </Typography>
            <Typography variant="body2" component="pre" sx={{ mt: 2 }}>
              {JSON.stringify(meta, null, 2)}
            </Typography>
            <Box sx={{ display: 'flex', justifyContent: 'flex-end', mt: 2 }}>
              <Typography variant="body2" color="primary" onClick={handleExpandClick} style={{ cursor: 'pointer' }}>
                {!expanded ? 'Mostrar JSON completo' : 'Ocultar JSON completo'}
                <ExpandMoreIcon style={{ transform: expanded ? 'rotate(180deg)' : 'rotate(0deg)', marginLeft: '4px' }} />
              </Typography>
            </Box>
            <Collapse in={expanded} timeout="auto" unmountOnExit>
              <Box sx={{ mt: 2 }}>
                <Typography variant="body2" component="pre">
                  {JSON.stringify(data, null, 2)}
                </Typography>
                <Typography variant="body2" component="pre" sx={{ mt: 2 }}>
                  {JSON.stringify(meta, null, 2)}
                </Typography>
              </Box>
            </Collapse>
          </CardContent>
        </Card>
      </Box>
    </Box>
  );
};

export default ResultsComponent;
